import React, {useState} from 'react';

const cake_types = {
    layer_cake: '../picture/layer-cake',
    birthday_cake: '../picture/birthday-cake',
    cup_cake: '../picture/cup-cake'};

class Category extends React.Component{

    render(){

        const cake_type = this.props.type;

        return(
            <section>
                <img href={cake_types[cake_type]} className="category-picture"/>
                <div className="category-desc">say something</div>
            </section>
        );
    }

}

export default Category;
